import React from "react";
import "./Project.css";

function Card() {
  return <div className="card"></div>;
}

const projects = () => {
  return (
    <div className="wrapper">
      <div>
        <h1 style={{ fontSize: 50, color: "white", marginTop: 100 }}>
          Projects
        </h1>
        <Card />
      </div>
    </div>
  );
};

export default projects;
